import React from 'react';

import '../App.css';

const SponsorCard = ({ sponsors }) => {

  return (
    <div className='SingleCard'>
      <div>
        <img src={process.env.PUBLIC_URL + sponsors.ImagePath} className="CardImage" alt={sponsors.FirstName} />
      </div>

      <div className='CardTitle'>
        <h3>
          {sponsors.FirstName + ' ' + sponsors.LastName}
        </h3>
        <h5>
          {sponsors.Title}
        </h5>
      </div>

      {/* <div className='CardText'>
        <p>
          {info.Intro}
        </p>
      </div> */}
    </div>
  )
}

export default SponsorCard
